@userland
def private_set_intersection(
    location: SPU,
    *,
    dataframes: Dict[PYU, PYUObject],
    keys: Dict[PYU, List[str]],
    recipient: PYU,
) -> VDataFrame:
    ix1, ix2 = location.psi_df(
        {
            WORLD.alice: keys[WORLD.alice],
            WORLD.bob: keys[WORLD.bob],
        },
        [dataframes[WORLD.alice], dataframes[WORLD.bob]],
        recipient.party,
    )
    return VDataFrame(
        {
            WORLD.alice: partition(ix1),
            WORLD.bob: partition(ix2),
        }
    )

